--  DDL for Function FN_RECIBO_CREADO
--------------------------------------------------------

  CREATE OR REPLACE FUNCTION "JAMBROCIO"."FN_RECIBO_CREADO" (vi_codigo_socio IN NUMBER,
                                             vi_codigo_recibo IN NUMBER,
                                             vi_indicador IN VARCHAR2) RETURN NUMBER IS

lv_respuesta    NUMBER := 0;
BEGIN
  IF vi_indicador = 'L' THEN
    SELECT 1 
      INTO lv_respuesta
    FROM sis_deudas_socio s
    WHERE s.CODIGORECIBO = vi_codigo_recibo AND s.CODIGOSOCIO = vi_codigo_socio AND s.ESTADO <> 2;
  END IF;
  IF vi_indicador = 'T' THEN
    SELECT total
      INTO lv_respuesta
    FROM sis_deudas_socio s
    WHERE s.CODIGORECIBO = vi_codigo_recibo AND s.CODIGOSOCIO = vi_codigo_socio AND s.ESTADO <> 2;
  END IF;
  IF vi_indicador = 'E' THEN
    SELECT estado
      INTO lv_respuesta
    FROM sis_deudas_socio s
    WHERE s.CODIGORECIBO = vi_codigo_recibo AND s.CODIGOSOCIO = vi_codigo_socio AND s.ESTADO <> 2;
  END IF;
 RETURN lv_respuesta;
END fn_recibo_creado;

