  -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- --
  PROCEDURE SP_GRABAR_LUZ_X_SOCIO(vi_codigo_socio         IN NUMBER,
                             vi_codigo_recibo            IN NUMBER,
                             vi_correlativo              IN NUMBER,
                             vi_lectura_inicial          IN NUMBER,
                             vi_lectura_final            IN VARCHAR,
                             vi_consumo_mes              IN NUMBER,
                             vi_cargo_energia            IN NUMBER,
                             vi_alumbrado_publico        IN NUMBER,
                             vi_servicio_mantenimiento   IN NUMBER,
                             vi_deuda_anterior           IN NUMBER,
                             vi_reconexion               IN NUMBER,
                             vi_total                    IN NUMBER,
                             vi_estado                   IN NUMBER,
                             vi_usuario_carga            IN VARCHAR2,
                             vi_fecha_carga              IN DATE,
                             vi_usuario_modifica         IN VARCHAR2,
                             vi_fecha_modifica           IN DATE,
                             vo_codigo_socio             OUT NUMBER,
                             vo_indicador                OUT VARCHAR,
                             vo_mensaje                  OUT VARCHAR) AS
  
  vl_codigo                 NUMBER;                              
  BEGIN
    
    IF vi_correlativo = 0 THEN
        
        SELECT SQ_RECIBO_LUZ_SOCIO.NEXTVAL INTO vl_codigo FROM DUAL;
        INSERT INTO sis_deudas_socio (codigosocio, codigorecibo, correlativo, lecturainicial, lecturafinal, consumomes, cargoenergia, alumbradopublico, mantenimiento, deudaanterior, reconexion, total, estado, impreso, usuariocarga, fechacarga, usuariomodifica, fechamodifica, codigo_servicio_detalle)
        VALUES (vi_codigo_socio, vi_codigo_recibo, vl_codigo, vi_lectura_inicial, vi_lectura_final, vi_consumo_mes, vi_cargo_energia, vi_alumbrado_publico, vi_servicio_mantenimiento, vi_deuda_anterior, vi_reconexion, vi_total, 1, 0, vi_usuario_carga, SYSDATE, null, null, 4);
        
        vo_codigo_socio := vl_codigo;
        vo_indicador := '00';
        vo_mensaje := 'Se registro satisfactoriamente el recibo de luz x socio.';
   
    ELSE
    
        UPDATE sis_deudas_socio
        SET
        lecturainicial = vi_lectura_inicial,
        usuariomodifica = vi_usuario_modifica, 
        fechamodifica = SYSDATE
        WHERE correlativo = vi_correlativo;
        
        vo_codigo_socio := vi_codigo_socio;
        vo_indicador := '00';
        vo_mensaje := 'Se modifico satisfactoriamente el recibo de luz x socio.';
        
    END IF;
  
  EXCEPTION 
    WHEN OTHERS THEN
      vo_codigo_socio := 0;
      vo_indicador := '01';
      vo_mensaje := SQLCODE || ' - ' || SQLERRM;
      ROLLBACK;  
    
  END SP_GRABAR_LUZ_X_SOCIO;
  -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- --
  PROCEDURE SP_ELIMINAR_LUZ_X_SOCIO(vi_codigo_socio       IN NUMBER,
                             vi_codigo_recibo             IN NUMBER,
                             vi_codigo_usuario            IN NUMBER,
                             vo_indicador                 OUT VARCHAR,
                             vo_mensaje                   OUT VARCHAR) AS
  BEGIN
    
    UPDATE sis_deudas_socio
    SET
    estado = 2, 
    usuariomodifica = vi_codigo_usuario, 
    fechamodifica = SYSDATE
    WHERE codigosocio = vi_codigo_socio and codigorecibo = vi_codigo_recibo;
        
    vo_indicador := '00';
    vo_mensaje := 'Se elimino el Recibo de Luz.';
  
  EXCEPTION 
    WHEN OTHERS THEN
      vo_indicador := '01';
      vo_mensaje := SQLCODE || ' - ' || SQLERRM;
      ROLLBACK;  
      
  END SP_ELIMINAR_LUZ_X_SOCIO;
  -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- --
  PROCEDURE SP_REPORTE_PUESTO_LUZ_SOCIO(vi_pagina       IN  NUMBER,
                              vi_registros              IN  NUMBER,
                              vi_codigo_socio           IN  NUMBER,
                              vi_codigo_luz_original    IN  NUMBER,
                              vo_total_registros        OUT NUMBER,
                              vo_result                 OUT SYS_REFCURSOR) AS
  vl_inicio NUMBER;
  vl_fin    NUMBER;                              
  BEGIN
    
    vl_fin := vi_pagina * vi_registros;
    vl_inicio := vl_fin - (vi_registros - 1);
    
    dbms_output.put_line ('INICIO : ' || vl_inicio); 
    dbms_output.put_line ('FIN : ' || vl_fin); 
    
    IF vi_codigo_socio = '0' THEN
    
        SELECT COUNT(*) INTO vo_total_registros
        FROM sis_puesto p;
        
        OPEN vo_result FOR
            SELECT B.ESTADORECIBOLUZ, B.CODIGORECIBOORIGINAL, B.CODIGOSECTOR, B.NOMBRESECTOR, B.CODIGO_SOCIO, B.NOMBREFULL, B.NROPUESTO, B.NOMBREGIRO, B.CODIGO_SERVICIO_DETALLE, 
              CASE WHEN (B.ESTADORECIBOLUZ=2) THEN 0 ELSE B.recibo_luz_creado END recibo_luz_creado, 
              CASE WHEN (B.ESTADORECIBOLUZ=2) THEN 0 ELSE B.TOTAL END total
            FROM (            
                  SELECT A.ESTADO ESTADORECIBOLUZ, A.CODIGORECIBOORIGINAL, A.CODIGOSECTOR, A.NOMBRESECTOR, A.CODIGO_SOCIO, A.NOMBREFULL, A.NROPUESTO, A.NOMBREGIRO, A.CODIGO_SERVICIO_DETALLE, A.recibo_luz_creado, A.total, ROWNUM numfila
                  FROM (
                      SELECT vi_codigo_luz_original CODIGORECIBOORIGINAL, se.CODIGO_SECTOR CODIGOSECTOR, se.NOMBRE_SECTOR NOMBRESECTOR, s.CODIGO_SOCIO, concat(concat(concat(concat(s.APELLIDO_PATERNO, ' '),s.APELLIDO_MATERNO), ','),s.nombres) NOMBREFULL, s.NRO_PUESTO NROPUESTO, gc.NOMBRE_GIRO NOMBREGIRO, ss.CODIGO_SERVICIO_DETALLE
                      , nvl(FN_RECIBO_CREADO(s.CODIGO_SOCIO,vi_codigo_luz_original,'L'),0) recibo_luz_creado
                      , nvl(FN_RECIBO_CREADO(s.CODIGO_SOCIO,vi_codigo_luz_original,'T'),0) total
                      , nvl(FN_RECIBO_CREADO(s.CODIGO_SOCIO,vi_codigo_luz_original,'E'),0) estado
                      FROM SIS_SOCIO_SERVICIO ss 
                        INNER JOIN SIS_SOCIO s ON s.CODIGO_SOCIO = ss.CODIGO_SOCIO
                        INNER JOIN SIS_GIRO_COMERCIAL gc ON s.CODIGO_GIRO = gc.CODIGO_GIRO
                        INNER JOIN SIS_SECTOR se ON se.CODIGO_SECTOR = gc.CODIGO_SECTOR
                      WHERE ss.CODIGO_SERVICIO_DETALLE = vi_codigo_luz_original
                      ) A
                 ) B
            WHERE numfila BETWEEN vl_inicio AND vl_fin;
            
    ELSE
    
        SELECT COUNT(*) INTO vo_total_registros
        FROM SIS_SOCIO_SERVICIO ss 
          INNER JOIN SIS_SOCIO s ON s.CODIGO_SOCIO = ss.CODIGO_SOCIO
          INNER JOIN SIS_GIRO_COMERCIAL gc ON s.CODIGO_GIRO = gc.CODIGO_GIRO
          INNER JOIN SIS_SECTOR se ON se.CODIGO_SECTOR = gc.CODIGO_SECTOR
        WHERE se.CODIGO_SECTOR = vi_codigo_socio;
        
        OPEN vo_result FOR
            SELECT B.ESTADORECIBOLUZ, B.CODIGORECIBOORIGINAL, B.CODIGOSECTOR, B.NOMBRESECTOR, B.CODIGO_SOCIO, B.NOMBREFULL, B.NROPUESTO, B.NOMBREGIRO, B.CODIGO_SERVICIO_DETALLE, 
              CASE WHEN (B.ESTADORECIBOLUZ=2) THEN 0 ELSE B.recibo_luz_creado END recibo_luz_creado, 
              CASE WHEN (B.ESTADORECIBOLUZ=2) THEN 0 ELSE B.TOTAL END total
            FROM (            
                  SELECT A.ESTADO ESTADORECIBOLUZ, A.CODIGORECIBOORIGINAL, A.CODIGOSECTOR, A.NOMBRESECTOR, A.CODIGO_SOCIO, A.NOMBREFULL, A.NROPUESTO, A.NOMBREGIRO, A.CODIGO_SERVICIO_DETALLE, A.recibo_luz_creado, A.total, ROWNUM numfila
                  FROM (
                      SELECT vi_codigo_luz_original CODIGORECIBOORIGINAL, se.CODIGO_SECTOR CODIGOSECTOR, se.NOMBRE_SECTOR NOMBRESECTOR, s.CODIGO_SOCIO, concat(concat(concat(concat(s.APELLIDO_PATERNO, ' '),s.APELLIDO_MATERNO), ','),s.nombres) NOMBREFULL, s.NRO_PUESTO NROPUESTO, gc.NOMBRE_GIRO NOMBREGIRO, ss.CODIGO_SERVICIO_DETALLE
                      , nvl(FN_RECIBO_CREADO(s.CODIGO_SOCIO,vi_codigo_luz_original,'L'),0) recibo_luz_creado
                      , nvl(FN_RECIBO_CREADO(s.CODIGO_SOCIO,vi_codigo_luz_original,'T'),0) total
                      , nvl(FN_RECIBO_CREADO(s.CODIGO_SOCIO,vi_codigo_luz_original,'E'),0) estado
                      FROM SIS_SOCIO_SERVICIO ss 
                        INNER JOIN SIS_SOCIO s ON s.CODIGO_SOCIO = ss.CODIGO_SOCIO
                        INNER JOIN SIS_GIRO_COMERCIAL gc ON s.CODIGO_GIRO = gc.CODIGO_GIRO
                        INNER JOIN SIS_SECTOR se ON se.CODIGO_SECTOR = gc.CODIGO_SECTOR                        
                      WHERE ss.CODIGO_SERVICIO_DETALLE = vi_codigo_luz_original AND s.CODIGO_SOCIO = vi_codigo_socio
                      ) A
                 ) B
            WHERE numfila BETWEEN vl_inicio AND vl_fin;
        
    END IF;
  END SP_REPORTE_PUESTO_LUZ_SOCIO;
  -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- -- --

END PKG_RECIBO_LUZ_SOCIO;

